import React, { useEffect, useState } from "react";
import axios from "axios";
import { Col, Row } from "react-bootstrap";
const MealsDetailse = ({cat}) => {

    return(
        <div>
            <div className="card">
                    <img src={cat.strMealThumb} className="card__image" alt="hu"/>
                    <div className="CardCategor">
                        <div className="w-100 p-2">
                            <p className="CategoryName">Thi{cat.strMeal}</p>
                        </div>
                    </div>
            </div>
        </div>
    )
}

export default MealsDetailse
